social_posts.post_text:
It’s been a whirlwind week. As a procrastinator..I always procrastinate! So last week I called @melbasharlem and said I wanted to show my collection! Yes, she shut down the streets of Harlem. Thank you @fdballiance I’m still just simply amazed at the love and support. Thank you @melbasharlem !!! To @rosemary_kokuhilwa who welcomed me to her country thank you. @kingsleymodels you for the model casting Thank you! The glam team @brithestylist the volunteers, the staff and crew at Melba’s, Jaret, Tim. My childhood bestie Eliza, My dear friend @rukuslive  @lolajbelle thank you all for thinking I am so crazy, but still coming through. Thank you @sherrieshepherd @sherrishowtv Thank you Rebecca for bringing all the fashion icons out. I am truly humbled by the village that came to support me.
The models!!!

@seko_shamte 🙏🏾. @stylebykingsley thank you for the model casting I know the stress I put on you in 5 days!. They were and are the highlights! Thank you to @stackmoses my incredible videographer I’ve worked with for years. He flew from Dallas to NYC the morning of the shoot! The glam team OMG thank you! Thank you! Thank you! @brithestylist THE girls just ate!  volunteers, the staff and crew at Melba’s, Jaret, Tim. My childhood bestie Eliza, My dear friends behind the scene @rukuslive @stephens.kellye @kimolusanya Thank you @rebeccamosesofficial  for bringing all the fashion icons out. I am truly humbled by the village that came to support me. @myrdith thank you @sherrieshepherd @sherrishowtv thanks! Thanks to my pastor Victor and my mommy and daddy who said i think we should send you some money for food to feed the models and I wholeheartedly said yes please! Never too old for that! Thank you @mylongstoryshort ! This is the beginning of so many great things!
